description:
The Football League Show 14.12.2013 

Duration: 1 hour 20 min

The Championship title race takes centre stage as one of the surprise early challengers, Blackpool, take on the pre-season favourites, QPR. And we've the best of the action from another crucial clash at the top as Leicester entertain Burnley.

All the drama from all three divisions of the Football League brought to you by Manish Bhasin.
